let count = 0 ; 
const ClickB = ()=>{
    count++; 
    console.log("Clicked"+count);
} 
const App= ()=>{
    return(<div>
            <h1>Hello World </h1>
            <button onClick={ClickB}>click</button>
         </div>
    ) ; 
}
export default App ;
